import org.custommonkey.xmlunit.*

log.info("Received Message ---> "+mockRequest.requestContent)

serviceOperation = mockOperation.getOperation()
log.debug("Operation: "+serviceOperation)

expectedRequestsList = serviceOperation.getRequestList()

for(i=0;i<expectedRequestsList.size();i++)
{
	def request = expectedRequestsList.get(i)
	//def requestContent = request.getRequestContent()
	def requestContent = context.expand(request.getRequestContent())
	log.info(request.getName()+": "+requestContent)

	XMLUnit.setIgnoreComments(true)
	XMLUnit.setIgnoreDiffBetweenTextAndCDATA(true)
	XMLUnit.setIgnoreWhitespace(true)

	def xmlDiff = XMLUnit.compareXML(mockRequest.requestContent, requestContent)

	if(xmlDiff.identical()||xmlDiff.similar())
	{
		log.info("Match Found --> "+request.getName())
		return request.getName()
	}

}
log.info("No match found. Responding with default response")

import org.custommonkey.xmlunit.*

class GoodsMovementDifferenceListener implements DifferenceListener
{
	def consideredList = new ArrayList();
	def log = null;

	GoodsMovementDifferenceListener()
	{

	}

	GoodsMovementDifferenceListener(List<String> excludedList, org.apache.log4j.Logger log)
	{
		consideredList.addAll(excludedList)
		this.log = log;
	}

	public int differenceFound(Difference diff) 
	{
		if (diff.getId() == DifferenceConstants.TEXT_VALUE_ID)
		{
			if(!consideredList.contains(diff.getControlNodeDetail().getNode().getParentNode().getNodeName()))
	 		{
				//log.error("Differenec Found -> "+diff.getControlNodeDetail().getNode().getParentNode().getNodeName()+": Expected ("+diff.getTestNodeDetail().getValue()+"), Actual ("+diff.getControlNodeDetail().getValue()+") --- REJECTED");	 			
	 			return DifferenceListener.RETURN_ACCEPT_DIFFERENCE;
	 		}
		}
		log.warn("Difference Found -> "+diff.getControlNodeDetail().getNode().getParentNode().getNodeName()+": Expected ("+diff.getTestNodeDetail().getValue()+"), Actual ("+diff.getControlNodeDetail().getValue()+") --- ACCEPTED");
		//System.out.println(diff.getControlNodeDetail().getNode().getParentNode().getNodeName()+": Expected ("+diff.getTestNodeDetail().getValue()+"), Actual ("+diff.getControlNodeDetail().getValue()+") --- ACCEPTED");
		return DifferenceListener.RETURN_IGNORE_DIFFERENCE_NODES_IDENTICAL;
	}	
	public void skippedComparison(org.w3c.dom.Node arg0, org.w3c.dom.Node arg1) { }
}

log.info("Received Message ---> "+mockRequest.requestContent)

//Get Nodes that need to be skipped while matching
def excludedListStr = mockOperation.getMockService().getPropertyValue("excludedListStr");
def excludedList = new ArrayList()
if(excludedListStr!= null || excludedListStr.equals(""))
{
	excludedList = Arrays.asList(excludedListStr.split("\\s*,\\s*"));
}


serviceOperation = mockOperation.getOperation()
log.debug("Operation: "+serviceOperation)
def xmlDiff = null;
expectedRequestsList = serviceOperation.getRequestList()

for(i=0;i<expectedRequestsList.size();i++)
{
	def request = expectedRequestsList.get(i)
	def requestContent = context.expand(request.getRequestContent())
	log.debug(request.getName()+": "+requestContent)

	XMLUnit.setIgnoreComments(true)
	XMLUnit.setIgnoreDiffBetweenTextAndCDATA(true)
	XMLUnit.setIgnoreWhitespace(true)

	xmlDiff = XMLUnit.compareXML(mockRequest.requestContent, requestContent);
	xmlDiff.overrideDifferenceListener(new GoodsMovementDifferenceListener(excludedList,log));	

	if(xmlDiff.identical()||xmlDiff.similar())
	{
		log.info("Match Found --> "+request.getName())
		return request.getName()
	}
}
log.info("No match found. Responding with default response")

